import React, { Component } from 'react';
import PlanGraph from './PlanGraph'
import Logo from './Logo'
import Footer from './Footer'

class Plan extends Component {
	render() {
  return (
    <div>
      <h2 className = "head">Pick the best day to go! 
      The crowds for the next 30 days are shown below</h2>
      <PlanGraph />
      <Footer />
    </div>
  );
}
}

export default Plan;
